def request_token():
  token_response = requests.post(
    'https://nirs.trinamixsensing.com/api/general/oauth/v2.0/token',
    json={
      'client_id': os.environ['TRINAMI_CLIENT_ID'],
      'client_secret': os.environ['TRINAMI_CLIENT_SECRET']
    }
  )
  return json.loads(token_response.text)

def request_measurement_page(page_number, last_updated, token):
  measurements_response = requests.post(
    f'https://nirs.trinamixsensing.com/api/organization/dataScience/measurements?PageNumber={str(page_number)}&PageSize=100&IncludeSpectra=true',
    headers={
      'Authorization': f'Bearer {token["access_token"]}',
      'Api-Version': '11.0',
      'accept': '*/*',
      'Content-Type': 'application/json'
    },
    json={
      'after': last_updated
    }
  )
  return json.loads(measurements_response.text)

def request_sample(sample_id, token):
  measurements_response = requests.post(
    f'https://nirs.trinamixsensing.com/api/organization/dataScience/measurements?IncludeSpectra=true',
    headers={
      'Authorization': f'Bearer {token["access_token"]}',
      'Api-Version': '11.0',
      'accept': '*/*',
      'Content-Type': 'application/json'
    },
    json={
      'sampleIdentity': sample_id
    }
  )
  return json.loads(measurements_response.text)

def get_new_measurements(last_updated, last_sample_ids, is_dev=False, use_trinami_api=True):
  new_measurements = []
  
  # only update if >1 minute has passed since last_updated
  last_updated_dt = datetime.datetime.strptime(last_updated[:19], '%Y-%m-%dT%H:%M:%S')
  if (datetime.datetime.now() - last_updated_dt).total_seconds() >= 60:
    # Get a token for interacting with TrinamiX database
    if use_trinami_api:
      token = request_token()
    else:
      token = ''

    # Loop pages until no results are returned
    page = 1
    while page != None:
      try:
        # Get the page of measurements
        if use_trinami_api:
          page_results = request_measurement_page(page, last_updated, token)
        else:
          page_results = []
        
        if is_dev:
          page_results = json.loads(measurements[str(page)])

        # If there is data add it to the return, otherwise end the loop
        if len(page_results['data']) > 0:
          new_measurements += page_results['data']
          page += 1
        else:
          page = None
      except Exception as err:
        print(err)
        page = None

    try:
      redo_measurements = []
      fetched_sample_ids = []
      # Loop measurements checking their sample ids against the sample ids from the last update
      #   If they match then get all of the measurements for that sample id and add them to the return
      #   This will allow the full samples to be scored later
      for measurement in new_measurements:
        if measurement['sampleIdentity'] in last_sample_ids and measurement['sampleIdentity'] not in fetched_sample_ids:
          if use_trinami_api:
            sample_measurements = request_sample(measurement['sampleIdentity'], token)
          else:
            sample_measurements = []
          
          if is_dev:
            # Expect 5971973 to be added but none of the others
            #  [5971972,5971971,5971970,5971969,3861116,3861115,3861114,3861113,3861111,3861109,3861108,3861107,3861106,3861105,2464290,2464289,2464288,2464287,2464286,2464285,2464284,2464283,2464282,2464281,1675268,1599891,1599889,1599888,1599886,1599885,1599883,1599882,1599881,1599880]
            sample_measurements = sample_matches
          
          redo_measurements += [s for s in sample_measurements['data'] if s['deviceIdentity'] == measurement['deviceIdentity']]
          fetched_sample_ids.append(measurement['sampleIdentity'])
      new_measurements += redo_measurements
    except Exception as err:
      print(err)
  
  return new_measurements